import React from "react";
import OrderPreviewItem from "./OrderPreviewItem"

function OrderPreview({addedItems}) {

    const orderPreview = addedItems.map((item) => 
    <OrderPreviewItem 
    key={item.id} 
    item={item} />)

    return (
        <div>
            Order Preview
            {orderPreview}
            <button>Go To Checkout</button>
        </div>
    )
}

export default OrderPreview;
